import React from 'react';
import RegisterForm from '../components/Auth/RegisterForm';
import './AuthPages.css';

const RegisterPage = () => {
  return (
    <div className="auth-page">
      <div className="auth-bg-orb" aria-hidden="true"></div>
      <div className="auth-container">
        <div className="auth-header">
          <div className="auth-kicker">E-Wallet</div>
          <h1>E-Wallet Registration</h1>
          <p>Create your account to get started with our e-wallet services.</p>
        </div>
        <RegisterForm />
        <div className="auth-footer-note">
          <span className="badge-secure">Secure</span> We never share your data.
        </div>
      </div>
    </div>
  );
};

export default RegisterPage;
